import React from "react";

import './question1Styles.css';

export default class Question1 extends React.Component{
    constructor(props){
        super(props);
        console.log(props.answeredCorrect);
        
        this.test = this.test.bind(this);
    }

    test(){
        console.log('test');
    }
    render(){
        return (
        <div className="questionBox">
            <div className="question">Q: What is JSX?</div>
            <div className="answer"><button onClick={this.test}>a) A standalone programming language</button></div>
            <div className="answer"><button>b) A CSS framework</button></div>
            <div className="answer correct"><button onClick={this.props.answeredCorrect}>c) A syntactic extension of JavaScript that looks like HTML</button></div>
            <div className="answer"><button>d) A templating engine</button></div>
        </div>
        )
    }
}
